import profileimage from "../images/profile.png";

import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
} from "reactstrap";

import "./header.css";


const Header: FC = () => {


  return (

    <div className="header">
      <a href="#default" className="logo">
        <img src={logoimage} />
      </a>
      <div className="header-right">

        <Link to="/user">
          <img src={profileimage} />
        </Link>

      </div>
    </div>
  );
};

export default Header;
